    Example:
    histogram('a b c') == {'a': 1, 'b': 1, 'c': 1}
    histogram('a b b a') == {'a': 2, 'b': 2}
    histogram('a b c a b') == {'a': 2, 'b': 2}
    histogram('b b b b a') == {'b': 4}
    histogram('') == {}
    """

    # split the input string into a list of lowercase letters
    letters = test.split()

    # initialize an empty dictionary to store the count of each letter
    count_dict = {}

    # loop through each letter in the list and update the count in the dictionary
    for letter in letters:
        if letter in count_dict:
            count_dict[letter] += 1
        else:
            count_dict[letter] = 1

    # find the maximum count and return the corresponding dictionary
    max_count = max(count_dict.values())
    result = {key: value for key, value in count_dict.items() if value == max_count}

    return result

